export default {
  name: 'PostTitle',
  props: {
    title: {
        type: String,
        default: 'This is an post api page',
    }
},
  setup(__props, { expose }) {
  expose();

const props = __props




const __returned__ = { props }
Object.defineProperty(__returned__, '__isScriptSetup', { enumerable: false, value: true })
return __returned__
}

}
